<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Big League Blues - Fantasy Baseball</title>
    <link href="https://fonts.googleapis.com/css2?family=Alfa+Slab+One&family=Archivo:wght@400;700&display=swap" rel="stylesheet">
    <script src="https://cdn.jsdelivr.net/npm/chart.js@4.4.0/dist/chart.umd.min.js"></script>
    <style>
        :root {
            --sandlot-red: #D32F2F;
            --sandlot-blue: #1976D2;
            --sandlot-white: #FFFFFF;
            --cream: #FFF8E1;
            --dark-text: #2C2C2C;
            --light-gray: #F5F5F5;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Archivo', sans-serif;
            background: var(--cream);
            color: var(--dark-text);
            min-height: 100vh;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
            padding: 20px;
        }

        header {
            text-align: center;
            padding: 30px 20px;
            background: var(--sandlot-white);
            border: 4px solid var(--sandlot-blue);
            margin-bottom: 30px;
            box-shadow: 0 4px 6px rgba(0,0,0,0.1);
        }

        h1 {
            font-family: 'Alfa Slab One', cursive;
            font-size: 3rem;
            color: var(--sandlot-red);
            text-shadow: 
                3px 3px 0 var(--sandlot-blue),
                6px 6px 0 rgba(0,0,0,0.1);
            letter-spacing: 2px;
            margin-bottom: 10px;
        }

        .subtitle {
            font-size: 0.95rem;
            color: var(--sandlot-blue);
            font-weight: bold;
            letter-spacing: 2px;
            text-transform: uppercase;
        }

        .nav-tabs {
            display: flex;
            gap: 10px;
            margin-bottom: 30px;
            flex-wrap: wrap;
        }

        .tab-button {
            font-family: 'Archivo', sans-serif;
            font-size: 0.95rem;
            font-weight: bold;
            padding: 10px 20px;
            background: var(--sandlot-white);
            color: var(--sandlot-blue);
            border: 3px solid var(--sandlot-blue);
            cursor: pointer;
            transition: all 0.2s;
            letter-spacing: 1px;
        }

        .tab-button:hover {
            background: var(--sandlot-blue);
            color: white;
        }

        .tab-button.active {
            background: var(--sandlot-red);
            color: white;
            border-color: var(--sandlot-red);
        }

        .module {
            display: none;
        }

        .module.active {
            display: block;
        }

        .card {
            background: white;
            border: 3px solid var(--sandlot-blue);
            padding: 30px;
            margin-bottom: 30px;
            box-shadow: 0 2px 8px rgba(0,0,0,0.1);
        }

        .card-header {
            font-family: 'Alfa Slab One', cursive;
            font-size: 1.6rem;
            margin-bottom: 20px;
            color: var(--sandlot-red);
            border-bottom: 3px solid var(--sandlot-blue);
            padding-bottom: 10px;
            letter-spacing: 1px;
        }

        .controls {
            display: flex;
            gap: 20px;
            margin-bottom: 20px;
            flex-wrap: wrap;
            align-items: center;
        }

        .control-group {
            display: flex;
            flex-direction: column;
            gap: 5px;
        }

        .control-group label {
            font-weight: bold;
            color: var(--sandlot-blue);
            font-size: 0.8rem;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }

        select {
            padding: 6px 10px;
            border: 2px solid var(--sandlot-blue);
            font-family: 'Archivo', sans-serif;
            font-size: 0.9rem;
            cursor: pointer;
            background: white;
        }

        select:focus {
            outline: none;
            border-color: var(--sandlot-red);
        }

        .table-container {
            overflow-x: auto;
            margin-bottom: 30px;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            background: white;
            border: 2px solid var(--sandlot-blue);
        }

        thead {
            background: var(--sandlot-red);
            color: white;
        }

        th {
            font-weight: bold;
            padding: 10px;
            text-align: center;
            border: 1px solid white;
            cursor: pointer;
            user-select: none;
            font-size: 0.85rem;
        }

        th:hover {
            background: #B71C1C;
        }

        th.sortable::after {
            content: ' ↕';
            opacity: 0.7;
            font-size: 0.7rem;
        }

        th.sorted-asc::after {
            content: ' ↑';
            opacity: 1;
        }

        th.sorted-desc::after {
            content: ' ↓';
            opacity: 1;
        }

        td {
            padding: 8px 10px;
            text-align: center;
            border: 1px solid #E0E0E0;
            font-size: 0.85rem;
        }

        tbody tr:nth-child(odd) {
            background: white;
        }

        tbody tr:nth-child(even) {
            background: var(--light-gray);
        }

        tbody tr:hover {
            background: #E3F2FD;
        }

        .manager-cell {
            font-weight: bold;
            text-align: left;
            color: var(--sandlot-blue);
        }

        tfoot {
            background: var(--sandlot-blue);
            color: white;
            font-weight: bold;
        }

        tfoot td {
            border: 1px solid white;
        }

        .rank-1 {
            background: #FFD700 !important;
            font-weight: bold;
        }

        .rank-2 {
            background: #C0C0C0 !important;
            font-weight: bold;
        }

        .rank-3 {
            background: #CD7F32 !important;
            font-weight: bold;
        }

        .chart-container {
            background: white;
            padding: 20px;
            margin-bottom: 20px;
            border: 2px solid var(--sandlot-blue);
        }

        .chart-title {
            font-family: 'Alfa Slab One', cursive;
            font-size: 1.25rem;
            margin-bottom: 15px;
            color: var(--sandlot-red);
            letter-spacing: 1px;
        }

        .footnote {
            font-size: 0.75rem;
            font-style: italic;
            color: #666;
            margin-top: 10px;
        }

        /* Baseball Card Styling */
        .baseball-card {
            max-width: 600px;
            margin: 30px auto;
            background: white;
            border: 4px solid var(--sandlot-blue);
            box-shadow: 0 8px 16px rgba(0,0,0,0.2);
            overflow: hidden;
        }

        .card-header-section {
            background: linear-gradient(135deg, var(--sandlot-red) 0%, #B71C1C 100%);
            color: white;
            padding: 20px;
            text-align: center;
            border-bottom: 4px solid var(--sandlot-blue);
        }

        .player-name {
            font-family: 'Alfa Slab One', cursive;
            font-size: 2rem;
            margin-bottom: 5px;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        }

        .card-body-section {
            padding: 30px;
        }

        .stats-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
            gap: 15px;
            margin-bottom: 20px;
        }

        .stat-box {
            background: var(--light-gray);
            border: 2px solid var(--sandlot-blue);
            padding: 15px;
            text-align: center;
        }

        .stat-label {
            font-size: 0.75rem;
            color: #666;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            margin-bottom: 5px;
        }

        .stat-value {
            font-size: 1.5rem;
            font-weight: bold;
            color: var(--sandlot-blue);
        }

        .chart-wrapper {
            margin-top: 20px;
            padding: 20px;
            background: var(--light-gray);
            border: 2px solid var(--sandlot-blue);
        }

        @media (max-width: 768px) {
            h1 {
                font-size: 2.5rem;
            }
            
            .tab-button {
                font-size: 1rem;
                padding: 10px 16px;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <header>
            <h1>BIG LEAGUE BLUES</h1>
            <div class="subtitle">Fantasy Baseball League</div>
        </header>

        <nav class="nav-tabs">
            <button class="tab-button active" onclick="switchModule('historical')">Historical Results</button>
            <button class="tab-button" onclick="switchModule('analytics')">Player Analytics</button>
            <button class="tab-button" onclick="switchModule('rosters')">Rosters</button>
        </nav>

        <div id="historical-module" class="module active">
            <div class="card">
                <div class="card-header">Historical Results</div>
                
                <div class="controls">
                    <div class="control-group">
                        <label for="managerType">Type</label>
                        <select id="managerType" onchange="buildHistoricalTable()">
                            <option value="active">Active Managers</option>
                            <option value="all">All</option>
                        </select>
                    </div>
                </div>
                
                <div id="historicalTable" class="table-container"></div>
                <div class="footnote">Average > 5Y = Average place of managers with more than 5 years of experience</div>
            </div>

            <div class="card">
                <div class="card-header">Aggregate Manager History</div>
                
                <div class="controls">
                    <div class="control-group">
                        <label for="aggregateMetric">Select Metric</label>
                        <select id="aggregateMetric" onchange="updateAggregateChart()">
                            <option value="championships">Championships by Manager</option>
                            <option value="medals">Medals (1st-3rd) by Manager</option>
                            <option value="netProfit">Net Profit by Manager</option>
                            <option value="roic">ROIC by Manager</option>
                        </select>
                    </div>
                </div>

                <div class="chart-container">
                    <canvas id="aggregateChart"></canvas>
                </div>
            </div>

            <div class="card">
                <div class="card-header">Manager Metrics</div>
                
                <div class="controls">
                    <div class="control-group">
                        <label for="timeseriesManager">Select Manager</label>
                        <select id="timeseriesManager" onchange="updateTimeseriesChart()">
                        </select>
                    </div>
                    <div class="control-group">
                        <label for="timeseriesMetric">Select Metric</label>
                        <select id="timeseriesMetric" onchange="updateTimeseriesChart()">
                            <option value="Final_Rank">Final Rank</option>
                            <option value="Total_Winnings">Total Winnings</option>
                            <option value="Total_Cost">Total Cost</option>
                            <option value="Net_Profit">Net Profit</option>
                            <option value="Players_Kept">Players Kept</option>
                            <option value="Base_Cost">Base Cost</option>
                            <option value="Extra_Round_Cost">Extra Round Cost</option>
                        </select>
                    </div>
                </div>

                <div class="chart-container">
                    <canvas id="timeseriesChart"></canvas>
                </div>
            </div>
        </div>

        <div id="analytics-module" class="module">
            <div class="card">
                <div class="card-header">Player Analytics</div>
                
                <div class="controls">
                    <div class="control-group">
                        <label for="playerSelect">Select Player</label>
                        <input 
                            type="text" 
                            id="playerSelect" 
                            list="playerList" 
                            placeholder="Start typing player name..."
                            onchange="loadPlayerCard()"
                            style="width: 300px; padding: 8px 12px; border: 2px solid var(--sandlot-blue); font-family: 'Archivo', sans-serif; font-size: 0.9rem;">
                        <datalist id="playerList"></datalist>
                    </div>
                    <div class="control-group">
                        <label for="adpMetric">Select Metric</label>
                        <select id="adpMetric" onchange="updatePlayerChart()">
                            <option value="Rank">Rank</option>
                            <option value="Average_ADP">Average ADP</option>
                            <option value="Keeper_Round">Keeper Round</option>
                        </select>
                    </div>
                </div>

                <div id="playerCardContainer"></div>
            </div>
        </div>

        <div id="rosters-module" class="module">
            <div class="card">
                <div class="card-header">Rosters</div>
                
                <div class="controls">
                    <div class="control-group">
                        <label for="rosterManager">Select Manager</label>
                        <select id="rosterManager" onchange="updateRosterYear()">
                            <option value="">-- Choose a Manager --</option>
                        </select>
                    </div>
                    <div class="control-group">
                        <label for="rosterYear">Select Year</label>
                        <select id="rosterYear" onchange="loadRoster()">
                            <option value="">-- Choose a Year --</option>
                        </select>
                    </div>
                    <div class="control-group">
                        <label for="downloadRoster">Download CSV</label>
                        <button id="downloadRoster" onclick="downloadRosterCSV()" style="padding: 6px 10px; border: 2px solid var(--sandlot-blue); font-family: 'Archivo', sans-serif; font-size: 0.9rem; cursor: pointer; background: white; font-weight: bold; color: var(--sandlot-blue);">
                            Download Roster(s)
                        </button>
                    </div>
                </div>

                <div id="rosterTableContainer"></div>
            </div>
        </div>
    </div>

        function buildHistoricalTable() {
            const managerType = document.getElementById('managerType').value;
            const displayManagers = managerType === 'active' ? 
                managers.filter(m => activeManagers.includes(m)) : 
                managers;
            
            const matrix = {};
            
            displayManagers.forEach(manager => {
                matrix[manager] = {};
                years.forEach(year => {
                    matrix[manager][year] = null;
                });
            });

            allData.forEach(row => {
                if (row.Metric_Type === 'Final_Rank' && matrix[row.Manager_Name]) {
                    matrix[row.Manager_Name][row.Year] = row.Value;
                }
            });

            const averages = {};
            const averages5Y = {};
            
            displayManagers.forEach(manager => {
                const ranks = years.map(year => {
                    const rank = matrix[manager][year];
                    if (!rank) return null;
                    return parseInt(rank);
                }).filter(r => r !== null);
                
                averages[manager] = ranks.length > 0 ? (ranks.reduce((a, b) => a + b, 0) / ranks.length).toFixed(2) : '-';
                
                if (ranks.length >= 5) {
                    averages5Y[manager] = (ranks.reduce((a, b) => a + b, 0) / ranks.length).toFixed(2);
                } else {
                    averages5Y[manager] = '-';
                }
            });

            let html = `
                <table id="historicalResultsTable">
                    <thead>
                        <tr>
                            <th class="sortable" onclick="sortHistoricalTable('manager')">Manager</th>
            `;
            
            years.forEach(year => {
                html += `<th class="sortable" onclick="sortHistoricalTable('${year}')">${year}</th>`;
            });
            
            html += `
                            <th class="sortable" onclick="sortHistoricalTable('average')">Average</th>
                            <th class="sortable" onclick="sortHistoricalTable('average5y')">Average > 5Y</th>
                        </tr>
                    </thead>
                    <tbody>
            `;

            displayManagers.forEach(manager => {
                html += `<tr data-manager="${manager}">`;
                html += `<td class="manager-cell">${manager}</td>`;
                
                years.forEach(year => {
                    const rank = matrix[manager][year];
                    const rankNum = rank ? parseInt(rank) : null;
                    const rankClass = rankNum === 1 ? 'rank-1' : rankNum === 2 ? 'rank-2' : rankNum === 3 ? 'rank-3' : '';
                    html += `<td class="${rankClass}" data-year="${year}">${rank || '-'}</td>`;
                });
                
                html += `<td data-average="${averages[manager]}">${averages[manager]}</td>`;
                html += `<td data-average5y="${averages5Y[manager]}">${averages5Y[manager]}</td>`;
                html += `</tr>`;
            });

            html += `
                    </tbody>
                </table>
            `;

            document.getElementById('historicalTable').innerHTML = html;
            
            sortState = { column: 'average5y', ascending: false };
            sortHistoricalTable('average5y');
        }

        let sortState = { column: null, ascending: true };

        function sortHistoricalTable(column) {
            const table = document.getElementById('historicalResultsTable');
            const tbody = table.querySelector('tbody');
            const rows = Array.from(tbody.querySelectorAll('tr'));

            if (sortState.column === column) {
                sortState.ascending = !sortState.ascending;
            } else {
                sortState.column = column;
                sortState.ascending = true;
            }

            rows.sort((a, b) => {
                let aVal, bVal;

                if (column === 'manager') {
                    aVal = a.querySelector('.manager-cell').textContent;
                    bVal = b.querySelector('.manager-cell').textContent;
                    return sortState.ascending ? aVal.localeCompare(bVal) : bVal.localeCompare(aVal);
                } else if (column === 'average') {
                    aVal = parseFloat(a.querySelector('[data-average]').getAttribute('data-average')) || 999;
                    bVal = parseFloat(b.querySelector('[data-average]').getAttribute('data-average')) || 999;
                } else if (column === 'average5y') {
                    const aStr = a.querySelector('[data-average5y]').getAttribute('data-average5y');
                    const bStr = b.querySelector('[data-average5y]').getAttribute('data-average5y');
                    aVal = aStr === '-' ? 999 : parseFloat(aStr);
                    bVal = bStr === '-' ? 999 : parseFloat(bStr);
                } else {
                    const aCell = a.querySelector(`[data-year="${column}"]`);
                    const bCell = b.querySelector(`[data-year="${column}"]`);
                    aVal = aCell ? parseInt(aCell.textContent) || 999 : 999;
                    bVal = bCell ? parseInt(bCell.textContent) || 999 : 999;
                }

                return sortState.ascending ? aVal - bVal : bVal - aVal;
            });

            rows.forEach(row => tbody.appendChild(row));

            table.querySelectorAll('th').forEach(th => {
                th.classList.remove('sorted-asc', 'sorted-desc');
            });
            
            const headerCells = Array.from(table.querySelectorAll('th'));
            const targetHeader = column === 'manager' ? headerCells[0] : 
                                 column === 'average' ? headerCells[headerCells.length - 2] :
                                 column === 'average5y' ? headerCells[headerCells.length - 1] :
                                 headerCells[years.indexOf(column) + 1];
            
            if (targetHeader) {
                targetHeader.classList.add(sortState.ascending ? 'sorted-asc' : 'sorted-desc');
            }
        }

        function updateAggregateChart() {
            const metric = document.getElementById('aggregateMetric').value;
            let chartData = {};
            let chartLabel = '';
            let chartColor = '';

            if (metric === 'championships') {
                chartLabel = 'Championships';
                chartColor = '#FFD700';
                allData.forEach(row => {
                    if (row.Metric_Type === 'Final_Rank' && row.Value === '1st') {
                        chartData[row.Manager_Name] = (chartData[row.Manager_Name] || 0) + 1;
                    }
                });
            } else if (metric === 'medals') {
                chartLabel = 'Medals (1st-3rd)';
                chartColor = '#1976D2';
                allData.forEach(row => {
                    if (row.Metric_Type === 'Final_Rank') {
                        const rank = parseInt(row.Value);
                        if (rank >= 1 && rank <= 3) {
                            chartData[row.Manager_Name] = (chartData[row.Manager_Name] || 0) + 1;
                        }
                    }
                });
            } else if (metric === 'netProfit') {
                chartLabel = 'Net Profit ($)';
                chartColor = '#4CAF50';
                const winnings = {};
                const costs = {};
                
                allData.forEach(row => {
                    if (row.Metric_Type === 'Total_Winnings' && row.Value) {
                        winnings[row.Manager_Name] = (winnings[row.Manager_Name] || 0) + parseFloat(row.Value);
                    }
                    if (row.Metric_Type === 'Total_Cost' && row.Value) {
                        costs[row.Manager_Name] = (costs[row.Manager_Name] || 0) + parseFloat(row.Value);
                    }
                });
                
                Object.keys(winnings).forEach(manager => {
                    chartData[manager] = winnings[manager] - (costs[manager] || 0);
                });
            } else if (metric === 'roic') {
                chartLabel = 'ROIC (Net Profit / Total Cost)';
                chartColor = '#9C27B0';
                const winnings = {};
                const costs = {};
                
                allData.forEach(row => {
                    if (row.Metric_Type === 'Total_Winnings' && row.Value) {
                        winnings[row.Manager_Name] = (winnings[row.Manager_Name] || 0) + parseFloat(row.Value);
                    }
                    if (row.Metric_Type === 'Total_Cost' && row.Value) {
                        costs[row.Manager_Name] = (costs[row.Manager_Name] || 0) + parseFloat(row.Value);
                    }
                });
                
                Object.keys(costs).forEach(manager => {
                    if (costs[manager] > 0) {
                        const netProfit = (winnings[manager] || 0) - costs[manager];
                        chartData[manager] = (netProfit / costs[manager]).toFixed(2);
                    }
                });
            }

            const sortedManagers = Object.keys(chartData).sort((a, b) => chartData[b] - chartData[a]);
            const chartValues = sortedManagers.map(m => chartData[m]);

            if (aggregateChartInstance) {
                aggregateChartInstance.destroy();
            }

            const ctx = document.getElementById('aggregateChart').getContext('2d');
            aggregateChartInstance = new Chart(ctx, {
                type: 'bar',
                data: {
                    labels: sortedManagers,
                    datasets: [{
                        label: chartLabel,
                        data: chartValues,
                        backgroundColor: chartColor,
                        borderColor: '#2C2C2C',
                        borderWidth: 2
                    }]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: true,
                    plugins: {
                        legend: { display: false }
                    },
                    scales: {
                        y: {
                            beginAtZero: true,
                            ticks: metric === 'roic' ? {} : { stepSize: 1 }
                        }
                    }
                }
            });
        }

        function loadRoster() {
            const manager = document.getElementById('rosterManager').value;
            const year = document.getElementById('rosterYear').value;
            
            if (!manager || !year) {
                document.getElementById('rosterTableContainer').innerHTML = '';
                return;
            }
            
            // Get roster for this manager and year
            const roster = rosterData.filter(r => 
                r.Manager_Name === manager && r.Year === year
            );
            
            if (roster.length === 0) {
                document.getElementById('rosterTableContainer').innerHTML = `
                    <p style="text-align: center; padding: 40px; color: #666;">
                        No roster data found for ${manager} in ${year}.
                    </p>
                `;
                return;
            }
            
            // Get prior year roster for this manager
            const priorYear = String(parseInt(year) - 1);
            const priorYearRoster = rosterData
                .filter(r => r.Manager_Name === manager && r.Year === priorYear)
                .map(r => r.Player_Name);
            
            // Join with ADP data to get Keeper_Round and determine Keeper Type
            const rosterWithData = roster.map(player => {
                // Find matching ADP record for this year and player
                const adpRecord = adpData.find(adp => 
                    adp.Year === year && 
                    adp.Player_Name === player.Player_Name && 
                    adp.Metric_Type === 'Keeper_Round'
                );
                
                // Check if player was on roster in prior year
                const wasOnPriorRoster = priorYearRoster.includes(player.Player_Name);
                const keeperType = wasOnPriorRoster ? 'Consecutive Year' : 'First Year';
                const baseCost = wasOnPriorRoster ? 5 : 10;
                
                return {
                    player: player.Player_Name,
                    keeperRound: adpRecord ? adpRecord.Value : '-',
                    keeperType: keeperType,
                    baseCost: baseCost
                };
            });
            
            // Sort by Keeper Round (numeric), then by player name
            rosterWithData.sort((a, b) => {
                const aRound = a.keeperRound === '-' ? 999 : parseInt(a.keeperRound);
                const bRound = b.keeperRound === '-' ? 999 : parseInt(b.keeperRound);
                if (aRound !== bRound) return aRound - bRound;
                return a.player.localeCompare(b.player);
            });
            
            // Build table
            let html = `
                <div class="table-container">
                    <table>
                        <thead>
                            <tr>
                                <th style="text-align: left;">Player Name</th>
                                <th>Keeper Round</th>
                                <th>Keeper Type</th>
                                <th>Base Cost</th>
                            </tr>
                        </thead>
                        <tbody>
            `;
            
            rosterWithData.forEach(item => {
                html += `
                    <tr>
                        <td style="text-align: left;">${item.player}</td>
                        <td>${item.keeperRound}</td>
                        <td>${item.keeperType}</td>
                        <td>$${item.baseCost}</td>
                    </tr>
                `;
            });
            
            // Calculate totals
            const totalBaseCost = rosterWithData.reduce((sum, item) => sum + item.baseCost, 0);
            
            html += `
                        </tbody>
                        <tfoot>
                            <tr>
                                <td style="text-align: left;"><strong>Total Players</strong></td>
                                <td><strong>${rosterWithData.length}</strong></td>
                                <td></td>
                                <td><strong>$${totalBaseCost}</strong></td>
                            </tr>
                        </tfoot>
                    </table>
                </div>
            `;
            
            document.getElementById('rosterTableContainer').innerHTML = html;
        }

        function downloadRosterCSV() {
            const year = document.getElementById('rosterYear').value;
            
            if (!year) {
                alert('Please select a year first!');
                return;
            }
            
            // Get all managers who have rosters in this year
            const managersInYear = [...new Set(rosterData
                .filter(r => r.Year === year)
                .map(r => r.Manager_Name))].sort();
            
            let rostersToDownload = [];
            
            // Process each manager
            managersInYear.forEach(mgr => {
                const roster = rosterData.filter(r => 
                    r.Manager_Name === mgr && r.Year === year
                );
                
                const priorYear = String(parseInt(year) - 1);
                const priorYearRoster = rosterData
                    .filter(r => r.Manager_Name === mgr && r.Year === priorYear)
                    .map(r => r.Player_Name);
                
                roster.forEach(player => {
                    const adpRecord = adpData.find(adp => 
                        adp.Year === year && 
                        adp.Player_Name === player.Player_Name && 
                        adp.Metric_Type === 'Keeper_Round'
                    );
                    
                    const wasOnPriorRoster = priorYearRoster.includes(player.Player_Name);
                    
                    rostersToDownload.push({
                        manager: mgr,
                        player: player.Player_Name,
                        keeperRound: adpRecord ? adpRecord.Value : '',
                        keeperType: wasOnPriorRoster ? 'Consecutive Year' : 'First Year',
                        baseCost: wasOnPriorRoster ? 5 : 10
                    });
                });
            });
            
            if (rostersToDownload.length === 0) {
                alert('No roster data to download!');
                return;
            }
            
            // Build CSV
            let csv = 'Manager,Player Name,Keeper Round,Keeper Type,Base Cost\n';
            rostersToDownload.forEach(row => {
                csv += `"${row.manager}","${row.player}","${row.keeperRound}","${row.keeperType}",${row.baseCost}\n`;
            });
            
            // Download
            const blob = new Blob([csv], { type: 'text/csv;charset=utf-8;' });
            const link = document.createElement('a');
            const url = URL.createObjectURL(blob);
            
            link.setAttribute('href', url);
            link.setAttribute('download', `all_rosters_${year}.csv`);
            link.style.visibility = 'hidden';
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
        }

        window.addEventListener('load', processData);
    </script>
</body>
</html>
